require "json"

class Comm
  @@enumOcrFileMethod = {
      "upload"=> "Upload",
      "recognize"=> "Recognize",
      "download"=> "Download"
  }

  def self.enumOcrFileMethod
    return @@enumOcrFileMethod
  end

  def self.getExampleImageBase64Data
    return ""
  end

  # parse httpWebResponse to restfulApiResult
  def self.parseHttpWebResponseToRestfulApiResult(httpWebResponse, strOcrFileMethod)
    if httpWebResponse == nil
      raise "httpWebResponse is null."
    end

    strContentType = httpWebResponse["Content-Type"]
    if strContentType.downcase.include? "application/json"
      return JSON.parse httpWebResponse.body
    else
      if(strOcrFileMethod == @@enumOcrFileMethod["upload"] or strOcrFileMethod == @@enumOcrFileMethod["recognize"])
          return nil
      end

      return httpWebResponse.body.force_encoding("UTF-16LE")[1..-1].encode("UTF-8")
    end
  end

  # handle restful api response to control ocr step and print message
  def self.handleRestfulApiResponse(restfulApiResponse, strOcrFileMethod)
    strFileName = nil

    if strOcrFileMethod == @@enumOcrFileMethod["upload"]
      if restfulApiResponse.class != Hash or restfulApiResponse["error_code"] != 0
        if restfulApiResponse.class != Hash
          puts "Upload Failed."
        else
          puts "Upload Failed: " + restfulApiResponse["error_msg"]
        end
        return strFileName
      end

      strFileName = restfulApiResponse["name"]
      puts "Upload success: " + strFileName

    elsif strOcrFileMethod == @@enumOcrFileMethod["recognize"]
      if !(restfulApiResponse.class == Hash and restfulApiResponse["outputs"].class == Array and
          restfulApiResponse["outputs"].length > 0 and restfulApiResponse["outputs"][0]["error_code"] == 0)
        if restfulApiResponse.class == Hash and restfulApiResponse["outputs"].class == Array and
            restfulApiResponse["outputs"].length > 0 and restfulApiResponse["outputs"][0]["error_code"] != 0
          puts "Recognization failed: " + restfulApiResponse["outputs"][0]["error_msg"]
        elsif restfulApiResponse.class == Hash and restfulApiResponse["error_code"] != 0
          puts "Recognization failed: " + restfulApiResponse["error_msg"]
        else
          puts "Recognization failed."
        end
        return strFileName
      end

      strFileName = restfulApiResponse["outputs"][0]["output"]
      puts "Recognization success: " + strFileName

    elsif strOcrFileMethod == @@enumOcrFileMethod["download"]
      if restfulApiResponse == nil or (restfulApiResponse.class == Hash and restfulApiResponse["error_code"] != 0)
        if restfulApiResponse.class == Hash and restfulApiResponse["error_code"] != 0
          puts "Download failed: " + restfulApiResponse["error_msg"]
        else
          puts "Download failed."
        end
        return strFileName
      end

      strFileName = ""
      puts "Result: " + restfulApiResponse

    else
      raise "Unsupported ocr method."
    end

    return strFileName
  end
end